import React, { Component, Fragment } from 'react';

class Todolist extends Component{

    render() {
        return (
            <Fragment>
                <div>
                    todo list
                </div>
                <div>
                    <input />
                    <button>add</button>
                </div>
                <ul>
                    <li>study chinese</li>
                    <li>study english</li>
                </ul>
            </Fragment>
        );
    }
}

export default Todolist;
